script: |
  super -f tsv -I q405.sql | sort > q405.out

vector: true

inputs:
  - name: q405.sql
    data: |
      SELECT 46 AS col2 FROM tab0 WHERE ( + col2 + + col0 ) NOT BETWEEN ( col0 * CAST ( 96 / col0 AS INTEGER ) ) AND + col2;
  - name: tab0

outputs:
  - name: q405.out
    data: |
      46
      46
      46
